    justifyContent: 'flex-start',
    borderRadius: 8,
    marginVertical: 8,
    marginHorizontal: 16,
  },
  buttonContainer: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'flex-start',
    justifyContent: 'flex-start',
  }
});
